import React,{useState} from "react";
import Axios from "axios";

function Note(props) {
  const [listOfUsers, setListOfUsers] = useState([]);

  // function handleClick(){
    // props.onDelete(props_id)
    const deleteNote=(id)=>{
      Axios.delete("http://localhost:3001/deleteUser/${id}").then(()=>{
      setListOfUsers(
        listOfUsers.filter((noteItem,index)=>{
          return index!=id;
        })
      )
    })
    }
  // }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={()=>{
        deleteNote(props._id)
      }}>DELETE</button>
    </div>
  );
}

export default Note;
